def prompt_delete_old_files():
    choice_window = tk.Toplevel()
    choice_window.title("Delete Old Files")
    choice_window.geometry("400x400")
    choice_window.configure(bg='#2e2e2e')
    center_window(choice_window, 400, 400)

    choice_var = tk.StringVar(value='n')

    def set_choice(choice):
        choice_var.set(choice)
        choice_window.destroy()

    ttk.Label(choice_window, text="Choose file type to delete:", background='#2e2e2e', foreground='white').pack(pady=10)

    ttk.Button(choice_window, text="Delete CSV Files", command=lambda: set_choice('c')).pack(pady=3)
    ttk.Button(choice_window, text="Delete Excel Files", command=lambda: set_choice('x')).pack(pady=3)
    ttk.Button(choice_window, text="Delete All Files", command=lambda: set_choice('a')).pack(pady=3)
    ttk.Button(choice_window, text="Do Not Delete Any Files", command=lambda: set_choice('n')).pack(pady=3)

    choice_window.wait_window()

    return choice_var.get()

def delete_files(file_type):
    files = glob.glob(f"*.{file_type}")
    for file in files:
        os.remove(file)
    if(file_type != 'ico'):
        messagebox.showinfo("Delete Files", f"All {file_type} files deleted.")

def base64_to_photoimage(base64_string: str) -> PhotoImage:
    # Decode the base64 string to bytes
    image_data = base64.b64decode(base64_string)
    # Create a BytesIO stream from the decoded bytes
    image_stream = BytesIO(image_data)
    # Open the image using PIL
    pil_image = Image.open(image_stream)
    # Convert the PIL image to a PhotoImage object
    photo_image = ImageTk.PhotoImage(pil_image)
    return photo_image


